import React from 'react';
import { motion } from 'framer-motion';

const Home = () => {
  const name = "Hi, I'm Bhabatosh Senapati";
  const nameArray = name.split("");

  return (
    <div className="relative min-h-screen overflow-hidden">
      {/* Animated background */}
      <div className="absolute inset-0 bg-gradient-to-r from-blue-50 via-white to-blue-50 animate-gradient">
        <div className="absolute inset-0 bg-[url('data:image/svg+xml;base64,')] opacity-10" />
      </div>

      {/* Content */}
      <div className="relative z-10">
        <motion.div
          initial={{ opacity: 0 }}
          animate={{ opacity: 1 }}
          transition={{ duration: 0.5 }}
          className="min-h-screen flex items-center justify-center"
        >
          <div className="max-w-6xl mx-auto px-4 py-20">
            <div className="text-center mb-16">
              <motion.div 
                initial={{ y: -20 }}
                animate={{ y: 0 }}
                className="text-5xl font-bold text-gray-800 mb-6 h-16 flex justify-center items-center"
              >
                {nameArray.map((letter, index) => (
                  <motion.span
                    key={index}
                    initial={{ opacity: 0 }}
                    animate={{ opacity: 1 }}
                    transition={{
                      duration: 0.1,
                      delay: index * 0.1,
                    }}
                  >
                    {letter}
                  </motion.span>
                ))}
              </motion.div>
              <motion.p 
                initial={{ y: 20 }}
                animate={{ y: 0 }}
                className="text-xl text-gray-600 mb-8"
              >
                Full Stack Developer | Problem Solver | Tech Enthusiast
              </motion.p>
              <motion.div
                initial={{ y: 20, opacity: 0 }}
                animate={{ y: 0, opacity: 1 }}
                transition={{ delay: 0.2 }}
                className="flex justify-center space-x-4"
              >
                <a 
                  href="#contact" 
                  className="btn btn-primary"
                >
                  Get In Touch
                </a>
                <a 
                  href="/projects" 
                  className="btn border border-gray-300 hover:border-gray-400"
                >
                  View My Work
                </a>
              </motion.div>
            </div>

            <motion.div 
              initial={{ y: 50, opacity: 0 }}
              animate={{ y: 0, opacity: 1 }}
              transition={{ delay: 0.4 }}
              className="grid grid-cols-1 md:grid-cols-2 gap-8 items-center bg-white/80 backdrop-blur-sm p-8 rounded-xl shadow-lg"
            >
              <div className="space-y-6">
                <h2 className="text-3xl font-bold text-gray-800">About Me</h2>
                <p className="text-gray-600 leading-relaxed">
                  A self-driven and passionate Full-Stack Developer with hands-on experience in building end-to-end web applications and integrating intelligent systems using Machine Learning and AI. Thrives on solving real-world problems through scalable, efficient, and user-centric solutions that empower individuals and organizations to work smarter and live betterâ€”while embracing innovation and sustainability.
                </p>
                <div className="flex gap-4">
                  <a 
                    href="/projects" 
                    className="btn btn-primary"
                  >
                    View My Work
                  </a>
                  <a 
                    href="/contact" 
                    className="btn border border-gray-300 hover:border-gray-400"
                  >
                    Contact Me
                  </a>
                </div>
              </div>
              <div className="relative">
                <div className="w-72 h-72 mx-auto rounded-full overflow-hidden border-4 border-white shadow-lg">
                  <img 
                    src="/profile.jpeg" 
                    alt="Bhabatosh Senapati" 
                    className="w-full h-full object-cover"
                  />
                </div>
              </div>
            </motion.div>
          </div>
        </motion.div>
      </div>
    </div>
  );
};

export default Home;
